    return (
        <Col xs={12} sm={3}>
            {/* <Panel bsStyle="primary">
                <Panel.Heading >
                    <Panel.Title componentClass="h3">
                        {props.title}
                    </Panel.Title>
                </Panel.Heading>
                <Panel.Body>
                    {props.body}
                </Panel.Body>
            </Panel> */}
            <CryptocurrencyCard 
                currencyName={props.name}
                currencyPrice={props.price}/>
        </Col>
    )
};

export default card;
